import sys, json
failures = json.load(open(sys.argv[1], 'rb'))

success = True

if failures['new']:
  success = False
  print 'New failures:'
  for f in failures['new']:
    print f

if failures['ignored']:
  print 'Ignored failures:'
  for f in failures['ignored']:
    print f

sys.exit(0 if success else 1)
